function LoginForm() {
  return (
    <div className="LoginForm">
        <form>
            <div class="form-group">
                <input type="username" class="form-control login-form-input-margin" id="username" aria-describedby="username" placeholder="Username"/>
            </div>
            <div class="form-group">
                <input type="password" class="form-control login-form-input-margin" id="password" placeholder="Password"/>
            </div>
            <button type="submit" class="btn btn-primary btn-color w-100">Log in</button>
        </form>
    </div>
  );
}

export default LoginForm;
